import React from 'react';

import 'antd/dist/antd.css';
import { Input } from 'antd';
const { Search } = Input;

function Hello(props) {
  return (
    <Search
      placeholder="input search text"
      onSearch={(value) => console.log(value)}
      style={{ width: 100 }}
    />
  );
}

export default Hello;
